CREATE PROCEDURE [dbo].[spAdmin_AcceptPendingAdminById]
	@Id int
AS

BEGIN
	INSERT INTO Admins
	(
		FirstName,
		LastName,
		Department,
		Username,
		[Password],
		HasPermissions
	)

	VALUES
	(
		@FirstName,
		@LastName,
		@Department,
		@Username,
		@Password,
		@HasPermissions
	)

	SELECT SCOPE_IDENTITY();
END

